import React from "react";
import { Routes, Route } from "react-router-dom";
import About from "./About";
import Contact from "./Contact";
import Error from "./Error";

const App = () => {
  return (
    <>
      <Routes>
        <Route path="/">
          <About />
        </Route>
        <Route path="contact">
          <Contact />
        </Route>
        <Route element={<Error />} />
      </Routes>
    </>
  );
};

export default App;
